//import logo from './logo.svg';
import './App.css';
import NavBar from "./components/NavBar";
import Footer from "./components/Footer";
import MultilanguageDirection from './components/MultilanguageDirection';
import { Button } from 'react-bootstrap';


function App() {
  return (
    <div className="App">
      <NavBar />
      <div>
        <div className="p-5 bg-image" style={{ backgroundImage: `url(/fietslabyrint-background-1.png)`, height: '300px', backgroundRepeat: 'no-repeat', backgroundSize: "cover" }} />
        <div className="mx-5">
          <div className="card mb-5 mx-md-5 bg-light bg-opacity-75 shadow-5-strong shadow-lg" id="no-scale" style={{ marginTop: "-75px", background: "hsla(0, 0%, 100%, 0.8)", backdropFilter: "blur(30px)" }}>
            <div className=" py-4">
              <div className="container">
                <NavLink className="mx-2" to="/companies">
                  <Button className="bg-gradient text-white px-5 mb-4">Back to Companies</Button>
                </NavLink>

              </div>
            </div>

          </div>
        </div>
      </div>


      <div>
        <MultilanguageDirection></MultilanguageDirection>
      </div>
      <Footer />
    </div>

  )
}

export default App;
